// import logo from "./logo.svg";
import "./App.css";
import NewsTop from "./components/NewsTop";
import Register from "./components/Register";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";
import NewsForDate from "./components/NewsForDate";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">DPMO</Link>
            </li>
            <li>
              <Link to="/NewsForDate">Ultimas-Noticas</Link>
            </li>
            <li>
              <Link to="/Register">Registro</Link>
            </li>
            <li>
              <Link to="/Login">Login</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/NewsForDate">
            <NewsForDate></NewsForDate>
          </Route>
          <Route path="/">
            <NewsTop />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
